import React, { Component } from "react";
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';
import "./App.css";
import axios from 'axios';
import SearchBar from '../src/components/SearchBar';

    const options = {
      chart: {
        type: 'spline'
      },
      title: {
        text: 'AAPL'
      },
      series: [
        {
          data: [100, 2, 100, 4, 300, 6]
        }
      ]
    };


    class App extends Component {
      constructor() {
        super();

    this.state = {
      stocks: [],
      term: null,
      value: ''
    };

    this.handleClick = this.handleClick.bind(this);
    this.handleChange = this.handleChange.bind(this);
    }

    handleChange(e) {
    this.setState({
      value: e.target.value
    });
    }

    handleClick(e) {
      if(e) e.preventDefault();

      this.setState({
        value: '',
        term: this.state.value,
        stocks: this.state.stocks
      });

    let term = this.state.value;
    const key = 'L0L4DTNSJZGG2DUV';
    const url = `https://www.alphavantage.co/query?function=BATCH_STOCK_QUOTES&symbols=${term}&apikey=${key}`;

    axios.get(axios.get(url)
    .then(res => {
      console.log(res.data['Stock Quotes']);
      const stocks = res.data['Stock Quotes'].map((stock) => [{symbol: stock.symbol, price: stock.price}])
    })
    .catch(error => console.log(error))
    )

    }

    render () {
    const value = this.state.value;
    return (
      <div className="App">
        <h1>Stock Search</h1>
    <p>{$stocks}</p>
      </div>
    );
    }
    }
    export default App;
